function Login() {
  const handleLogin = () => {
    window.location.href = 'http://localhost:8080/authorize';  // Adjust if your Flask app is on a different base URL
  };

  return (
    <div>
      <button onClick={handleLogin}>Login with Spotify</button>
    </div>
  );
}

export default Login;
